import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <ul>
      <li>
        <h3>Vidly</h3>
      </li>
      <li>
        <Link to="/">Movies</Link>
      </li>
      <li>
        <Link to="/customers">Customers</Link>
      </li>
      <li>
        <Link to="/rentals">Rentals</Link>
      </li>
    </ul>
  );
};

export default NavBar;
